import { StatusBar } from "expo-status-bar";
import { StyleSheet, Text, View, Image, Button } from "react-native";
import MaterialIcons from "react-native-vector-icons/MaterialIcons";
import FontAwesome from "react-native-vector-icons/FontAwesome";
import { Dimensions } from "react-native";
import Feather from "react-native-vector-icons/Feather";
import * as React from "react";
import { NavigationContainer } from "@react-navigation/native";
import { createNativeStackNavigator } from "@react-navigation/native-stack";
import CardIcon from "./assets/coffeecard(1).ico";
const Stack = createNativeStackNavigator();

function MainScreen({ navigation }) {
  const name = "Julian";
  let greetings = ["Hello", "Welcome back", "Hey ðŸ‘‹", "Good Morning"];
  let randomGreeting = greetings[Math.floor(Math.random() * greetings.length)];
  return (
    <View style={styles.maincontainer}>
      <View style={styles.greetings}>
        <Text style={{ fontSize: 36, fontWeight: "normal" }}>
          {randomGreeting},{"\n"}
          <Text style={{ fontWeight: "bold" }}>{name}</Text>
        </Text>
        <FontAwesome.Button
          name="user-circle"
          backgroundColor="0"
          size={50}
        ></FontAwesome.Button>
      </View>
      <CoffeeSaved />
      <View style={styles.qr}>
        <Image
          source={require("./assets/QR_code_for_mobile_English_Wikipedia.svg")}
          style={{
            height: "100%",
            width: "80%",
            resizeMode: "contain",
            borderRadius: 30,
            borderWidth: 5,
            backgroundColor: "#d3d3d3",
          }}
        />
      </View>
      <NavBar navigation={navigation} />
    </View>
  );
}

function CardScreen({ navigation, route }) {
  return (
    <View>
      <Text>card Screen</Text>
      <NavBar navigation={navigation} />
    </View>
  );
}
function StoresScreen({ navigation }) {
  return (
    <View>
      <Text>shop Screen</Text>
      <NavBar navigation={navigation} />
    </View>
  );
}
function SettingsScreen() {
  return (
    <View>
      <Text>settings Screen</Text>
    </View>
  );
}

function NavBar({ navigation }) {
  return (
    <View style={styles.navbar}>
      <Button
        style={styles.button}
        title={
          <Image
            source={require("./assets/coffeecard(1).ico")}
            style={styles.icon}
            onPress={() => navigation.navigate("Home")}
          ></Image>
        }
        onPress={() => navigation.navigate("card")}
      ></Button>

      <MaterialIcons.Button
        name="qr-code"
        onPress={() => navigation.navigate("Home")}
        backgroundColor="0"
        size={50}
      ></MaterialIcons.Button>

      <MaterialIcons.Button
        name="storefront"
        onPress={() => navigation.navigate("stores")}
        backgroundColor="0"
        size={50}
      ></MaterialIcons.Button>
    </View>
  );
}

function CoffeeSaved() {
  let coffeeSaves = 1;
  let cashSave = coffeeSaves * 4.5;
  return (
    <View style={styles.coffeesaved}>
      <Text>Free Coffees </Text>
      <Text>
        {coffeeSaves}
        <Image
          source={require("./assets/3dCup.png")}
          style={{ width: 100, height: 100, marginLeft: 10 }}
        />
      </Text>
      {/* <Text>{`$${cashSave}`}</Text> */}
    </View>
  );
}

export default function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Home">
        <Stack.Screen
          name="Home"
          component={MainScreen}
          options={{
            headerStyle: {
              opacity: 0,
              height: 0,
            },
          }}
        />
        <Stack.Screen
          name="card"
          component={CardScreen}
          options={{
            headerStyle: {
              opacity: 0,
              height: 0,
            },
          }}
        />
        <Stack.Screen
          name="stores"
          component={StoresScreen}
          options={{
            headerStyle: {
              opacity: 0,
              height: 0,
            },
          }}
        />
        <Stack.Screen
          name="settings"
          component={SettingsScreen}
          options={{
            headerStyle: {
              opacity: 0,
              height: 0,
            },
          }}
        />
      </Stack.Navigator>
    </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  maincontainer: {
    height: Dimensions.get("window").height,
    width: "100%",
    backgroundColor: "#fff",
    flexDirection: "column",
    rowGap: 30,
  },

  image: {
    width: 100,
    height: 100,
    borderRadius: 18,
  },
  icon: {
    width: 40,
    height: 40,
  },
  greetings: {
    flex: 1.5,
    backgroundColor: "#d3d3d3",
    borderBottomLeftRadius: 40,
    borderBottomRightRadius: 40,
    flexDirection: "row",
    width: "100%",
    justifyContent: "space-between",
    alignItems: "flex-end",
    padding: 40,
  },
  coffeesaved: {
    flex: 1,
    backgroundColor: "#d3d3d3",
    borderRadius: 44,
    justifyContent: "center",
    alignItems: "center",
    marginHorizontal: 50,
  },
  qr: {
    flex: 3,

    width: "100%",

    justifyContent: "center",
    alignItems: "center",
    alignSelf: "center",
  },
  navbar: {
    backgroundColor: "#d3d3d3",
    flex: 1,
    flexDirection: "row",
    justifyContent: "space-evenly",
    alignItems: "center",
    width: "100%",
    borderTopLeftRadius: 40,
    borderTopRightRadius: 40,
  },
  button: {
    borderRadius: 50,
    backgroundColor: "0",
    borderWidth: 2,
    justifyContent: "center",
    alignSelf: "center",
  },
});
